import Layout from '../components/Layout';

const Index = () => (
    <Layout>
        <p>Hello Next.js</p>
        <style jsx>{`
        h1,
        a {
          font-family: 'Arial';
          text-decoration: none;
          color: red;
        }

        a:hover {
          opacity: 0.6;
        }
      `}</style>
    </Layout>
);

export default Index;
